import React from 'react';
import ReactDOM from 'react-dom';
import { useState } from 'react';
import $ from 'jquery';
import './style.css';

function Container() {
  return (
    <>
      <StatusBar />
      <div className='container'>
        <Frame type='river' />
        <Frame type='bank' />
      </div>
    </>
  )
}

function StatusBar() {
  return (
    <div className='statusBar'>
      hello!
    </div>
  )
}

function Frame({type}) {
  const [lists, setLists] = useState([
    { title: '1', text: '1'},
    { title: '2', text: '1'},
    { title: '3', text: '1'},
    { title: '4', text: '1'},
    { title: '5', text: '1'},
    { title: '6', text: '1'},
    { title: '7', text: '1'},
  ]);
  const div = (
    <div id={type} className='frame'>
      {lists.map(x => {
        return <List key={x.title} title={x.title} text={x.text} />
      })}
    </div>
  )
  return div;
}

function List({title, text}) {
  return (
    <div className='list'>
      <h1>{title}</h1>
      <ul>{text}</ul>
    </div>
  )
}

function Task({type}) {
  return <li className='task'>task</li>
}

function init() {
  ReactDOM.render(<Container />, $('#root'));
}

init();
